import React, { Component } from 'react';
import { Container, Jumbotron } from 'react-bootstrap'


class AboutMe extends Component {
  render() {
    return (
        <Jumbotron>
            <Container>
                <h1>About Me</h1>
                <h2>My name is Randy Meneses, and I'm a Full Stack Web Developer</h2>
                <p>
                    Hi, first I'd like to thank you for checking out my page.

                </p>
            </Container>
        </Jumbotron>
    );
  }
}

export default AboutMe;
